import React from "react";

const Header = () => {
  return (
    <header className="top-bar">
      <div className="h">
        <h1>We`Blog</h1>
      </div>
      <div id="input3">
        <button onClick={openRegister}>Register</button>
        <button onClick={openLogin}>Log in</button>
      </div>
    </header>
  );
};

// Define the openRegister function (logic to open registration modal or redirect)
function openRegister() {
  console.log("Register clicked");
  // You can add logic here to open a registration form or navigate to the register page
}

// Define the openLogin function (logic to open login modal or redirect)
function openLogin() {
  console.log("Login clicked");
  // You can add logic here to open a login form or navigate to the login page
}

export default Header;
